(window.webpackJsonp=window.webpackJsonp||[]).push([[1013],{1149:function(e){e.exports={content:'<pre class="hljs"><code>init -&gt; v1 -&gt; v2 -&gt; v3 -- faulty merge -&gt; v4  (master)\n           \\            /                     \n            d1  --&gt;  d2                                   \n</code></pre>\n<p>\u73b0\u5728\u5728v4\uff0cd2\u6709bug\uff0c\u60f3\u5148\u53d6\u6d88\u5408\u5e76</p>\n<p>\u4f7f\u7528`git reset &quot;fault merge&quot;\uff0cv4\u4e5f\u4e0d\u5b58\u5728\u4e86</p>\n<p>\u4f7f\u7528 <code>git revert &quot;fault merge&quot;</code>\uff0c \u4e0d\u4f1a\u5f71\u54cd\u5230v4</p>\n<p>revert\u540e\u662f\u8fd9\u6837\u7684\uff0c\u76ee\u524d\u5728revert merge</p>\n<pre class="hljs"><code>init -&gt; v1 -&gt; v2 -&gt; v3 -- faulty merge -&gt; v4  (master) -&gt;revert merge\n           \\            /                     \n            d1  --&gt;  d2  \n</code></pre>\n<p>\u7ee7\u7eed\u6dfb\u52a0\u6587\u4ef6</p>\n<pre class="hljs"><code>init -&gt; v1 -&gt; v2 -&gt; v3 -- faulty merge -&gt; v4  (master) -&gt;revert merge -&gt;v5\n           \\            /                     \n            d1  --&gt;  d2  --&gt;d3 --&gt;d4\n</code></pre>\n<p>\u73b0\u5728\u5728v5 \u9700\u8981\u5408\u5e76 dev</p>\n<p>\u76f4\u63a5<code>git merge dev</code> \u53ea\u80fd\u5408\u5e76 d3\u548cd4</p>\n<p>\u67092\u79cd\u529e\u6cd5\uff0c</p>\n<ol>\n<li>\n<p>\u5728d1,\u548cd2\u4e0a\u624b\u52a8\u4fee\u6539\uff0c\u5373\u4f7f\u6dfb\u52a0\u4e00\u4e2a\u7a7a\u683c\uff1b\u7136\u540e\u56de\u5230master\uff0c<code>git merge dev</code>\uff0c\u5904\u7406\u51b2\u7a81\u4fbf\u53ef\uff08\u6bcf\u4e2a\u6587\u4ef6\u90fd\u4fee\u6539\u592a\u9ebb\u70e6\uff09</p>\n</li>\n<li>\n<p>\u518d\u6b21revert\u5230\u4e4b\u524drevert\u7684\u90e8\u5206\uff0c<code>git revert &quot;revert merge&quot;</code>,\u7136\u540e\u4f1a\u53d1\u73b0d1\u548cd2\u53c8\u56de\u6765\u4e86(\u6700\u521d\u7684\u6709bug\u7684\u7248\u672c)\uff0c\u518d<code>git merge dev</code>\u5c06\u4fee\u6b63\u7684\u7248\u672c\u5408\u5e76\u8fdb\u6765\uff0c\u5904\u7406\u51b2\u7a81\u5373\u53ef</p>\n</li>\n</ol>\n<blockquote>\n<p>\u53e6\uff1a \u7b2c2\u6b65\u53cd\u8fc7\u6765\u4e5f\u53ef\uff0c\u5148<code>git merge dev</code>\uff0c\u5c06\u6539\u52a8\u8fc7\u7684\u5408\u5e76\u8fdb\u6765\uff0c\u518d<code>git revert &quot;revert merge&quot;</code>\uff0c\u5904\u7406\u51b2\u7a81</p>\n</blockquote>\n<hr>\n<blockquote>\n<p>\u81ea\u5df1\u6ce8\uff1agit-test\u76ee\u5f55\u4e2d\uff0c\u76ee\u524d\u6b63\u5728v5\uff0cdev\u7684dev-1\uff0cdev-2\u662f\u88abrevert\u7684\uff0cdev-2\u505a\u4e86\u4fee\u6539\uff0c\u53ef\u4ee5\u4f7f\u7528\u7b2c2\u6216\u8005\u7b2c3\u79cd\u65b9\u6cd5</p>\n</blockquote>\n'}}}]);
